function TableRow( { rows }) {
    const keys = Object.keys(rows.length?rows[0]:{});

    return (

        <tbody>
            {
                rows.map((value) => 
                <tr>
                    {keys.map(key => <td key={key}>{value[key]}</td>)}
                </tr>)
            }
        </tbody>
    )
}

